import { Link } from 'react-router-dom'
import './LandingPage.css';

function LandingPage() {
  return (
    <div className="container">
        <Link to="/game">
            <button type="button">
                Click Me
            </button>
        </Link>
        <Link to="/rules">
            <button type="button">
                Click Me
            </button>
        </Link>
    </div>
  );
}

export default LandingPage;
